import React from "react";
// Styling


const SearchBar = (props) => {
  return (
    <input className="searchBar"
      onChange={(event) => props.setQuery(event.target.value.toLowerCase)}
      placeholder="Search for a cookie name"
    />
  );
};

export default SearchBar;
